Citizen.CreateThread(function()
    for _, poi in next, POI do
        TriggerEvent("lite:client:poi:create:" .. poi.type, poi)
    end
end)

local HideablePOIs = {
    "fuel",
    "service",
    "dealership",
}
local function isHideablePOI(type)
    for _, typ in next, HideablePOIs do
        if type == typ then
            return true
        end
    end
    return false
end

function HideAllPOIs()
    for _, poi in next, POI do
        if isHideablePOI(poi.type) then
            if poi.blip then
                SetBlipAlpha(poi.blip, 0)
            end
        end
    end
end

function ShowAllPOIs()
    for _, poi in next, POI do
        if isHideablePOI(poi.type) then
            if poi.blip then
                SetBlipAlpha(poi.blip, 255)
            end
        end
    end
end

function GetPOIs(poiType)
    local _t = {}
    for _, poi in next, POI do
        if poi.type == poiType then
            table.insert(_t, poi)
        end
    end
    return _t
end

function GetPOI(id)
    for _, poi in next, POI do
        if poi.id == id then
            return poi
        end
    end
    return nil
end

local function randomPOI(poiType)
    local _t = {}
    for _, poi in next, POI do
        if poi.type == poiType then
            table.insert(_t, poi)
        end
    end
    if #_t > 0 then
        return _t[math.random(#_t)]
    end
    return nil
end

local function randomPOIDist(poiType, pos, dist)
    if type(pos) ~= 'vector3' then
        if type(pos) ~= 'table' then
            return nil
        end
        pos = vector3(pos.x or 0.0, pos.y or 0.0, pos.z or 0.0)
    end
    dist = dist or 5.0
    local _t = {}
    for _, poi in next, POI do
        if poi.type == poiType then
            if #(pos - poi.pos) > dist then
                table.insert(_t, poi)
            end
        end
    end
    if #_t > 0 then
        return _t[math.random(#_t)]
    end
    return nil
end

function ClosestPOI(poiType, pos)
    if type(pos) ~= 'vector3' then
        if type(pos) ~= 'table' then
            return nil
        end
        pos = vector3(pos.x or 0.0, pos.y or 0.0, pos.z or 0.0)
    end
    local closest = nil
    local dist = 0.0
    for _, poi in next, POI do
        if poi.type == poiType then
            local _dist = #(pos - poi.pos)
            if _dist <= dist or closest == nil then
                dist = _dist
                closest = poi
            end
        end
    end
    return closest, dist
end

function RandomPOI(poiType, pos, minDist)
    if not pos then return randomPOI(poiType) end

    return randomPOIDist(poiType, pos, minDist)
end
